import React from "react";
import { Route, Routes } from "react-router-dom";
import CategoryHome from "./components/categories/CategoryHome";

function App() {
  return (
    <React.Fragment>
      <Routes>
        <Route path="/Home" element={<CategoryHome />}></Route>
        <Route path="/Register" element={<Register />}></Route>
        <Route path="/Login" element={<Login />}></Route>
        <Route path="/Friends" element={<Friends />}></Route>
        <Route path="/Friends/new" element={<FriendForm />}></Route>
        <Route path="/Friends/:id" element={<FriendForm />}></Route>

        {/* 
        <Route path="/Events" element={<Events />}></Route>
        <Route path="/Jobs" element={<Jobs />}></Route>
        <Route path="/Companies" element={<Companies />}></Route> */}
      </Routes>

      {/* <TestAndAjax></TestAndAjax> */}
      <Footer></Footer>
    </React.Fragment>
  );
}

export default App;
